	"sap/dashboard/fragment/master/EditRichContentDialog.fragment.xml":'<core:FragmentDefinition\r\n    xmlns:core="sap.ui.core"\r\n    xmlns="sap.m"\r\n><Dialog\r\n        showHeader="true"\r\n        title="{oMasterModel>/oRichContent/sRichConTitle}"\r\n        contentWidth="30rem"\r\n        contentHeight="20rem"\r\n    ><TextArea\r\n            value="{path:\'oMasterModel>/oRichContent/sRichConDetail\', formatter:\'.formatter.convertJoinToList\'}"\r\n            width="95%"\r\n            class="sapUiTinyMargin"\r\n            rows="12"\r\n            change="onChgRichDetails"\r\n        /><buttons><Button\r\n                text="{i18n>save}"\r\n                type="Emphasized"\r\n                press="onRichDialogSave"\r\n            /><Button\r\n                text="{i18n>cancel}"\r\n                press="onRichDialogClose"\r\n            /></buttons></Dialog></core:FragmentDefinition>\r\n',
