	"sap/dashboard/view/App.view.xml":'<mvc:View\r\n    xmlns:mvc="sap.ui.core.mvc"\r\n    xmlns="sap.m"\r\n    displayBlock="true"\r\n    xmlns:tnt="sap.tnt"\r\n    controllerName="sap.dashboard.controller.App"\r\n><tnt:ToolPage id="toolPage"><tnt:header><tnt:ToolHeader><Button\r\n                    id="sideNavigationToggleButton"\r\n                    icon="sap-icon://menu2"\r\n                    type="Transparent"\r\n                    press=".onSideNavButtonPress"\r\n                    tooltip="{i18n>navBtnTooltip}"\r\n                ><layoutData><OverflowToolbarLayoutData priority="NeverOverflow" /></layoutData></Button><ToolbarSpacer /><Title text="{mainModel>/sPageTitle}" /><ToolbarSpacer /></tnt:ToolHeader></tnt:header><tnt:sideContent><tnt:SideNavigation\r\n                id="idSideNav"\r\n                expanded="true"\r\n                selectedKey="{mainModel>/selectedNavListKey}"\r\n                itemSelect=".onItemSelect"\r\n            ><tnt:NavigationList items="{mainModel>/navList}"><tnt:NavigationListItem\r\n                        key="{mainModel>id}"\r\n                        text="{mainModel>text}"\r\n                        icon="{mainModel>icon}"\r\n                        visible="{mainModel>visible}"\r\n                    /></tnt:NavigationList><tnt:fixedItem><tnt:NavigationList><tnt:NavigationListItem\r\n                            id="idMaster"\r\n                            text="Master View"\r\n                            icon="sap-icon://wrench"\r\n                        /></tnt:NavigationList></tnt:fixedItem></tnt:SideNavigation></tnt:sideContent><tnt:mainContents><NavContainer id="pagesContainer" /></tnt:mainContents></tnt:ToolPage></mvc:View>\r\n',
